import React from 'react';

function Acceuil(props) {
  return (
    <div className="container" style={{ minWidth: "100%", maxHeight: "100%" }}>
      <div className="row">
        <div className="col-12">
          {props?.role === 1 && "hello admin" }
          {props?.role === 2 && "hello guichet droit arabe" }
          {props?.role === 3 && "hello guichet droit francais" }
          {props?.role === 4 && "hello guichet economie" }
          {props?.role === 5 && "hello service de diplomes" }
          {props?.role === 6 && "hello decanat" }
          {props?.role === 7 && "hello bureau d'ordre" }
          {props?.role === 8 && "hello guichet de retrait" }
        </div>
      </div>
    </div>
  );
}

export default Acceuil;
